import React, {useState} from "react"
import CUButton from "../../components/CUButton/CUButton"
import Dialog from "../../components/Dialog/Dialog"

const Home = () => {
    const [isOpen, setIsOpen] = useState(false)

    const handleCloseDialog = () =>{
        setIsOpen(false)
    }
    const handleButtonClick = () =>{
        setIsOpen(true)
    }
    console.log(isOpen)
    return <div>
        <CUButton onClick={handleButtonClick}></CUButton>
        <Dialog open={isOpen} title="CREATE USER" onClose={handleCloseDialog}></Dialog>
        </div>
}



export default Home
